package calculator;

import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.ObjectInputStream;
import java.io.ObjectOutputStream;
import java.util.ArrayList;
import java.util.List;

public class SaveManager {

	private List<String> results;
	
	public SaveManager(){
		results = new ArrayList<String>();
	}
	
	/**
	 * Läs sparad data från fil.
	 */
	public List<String> readFromDisk(String filename)
	{
		try 
		{
			ObjectInputStream in = new ObjectInputStream(new FileInputStream(filename));
			results = (List<String>) in.readObject();
		    in.close();
		    return results;
		}
	    catch (Exception ex) 
	    {
			System.out.println("Error: " + ex.toString());
		}
		return results;
	}
	
	/**
	 * Spara listan med information till fil.
	 */
	public void saveToDisk(String filename, List<String> results)
	{
		try 
		{
			ObjectOutputStream out = new ObjectOutputStream(new FileOutputStream(filename));
		    out.writeObject(results);
		    out.close();
		} 
		catch (Exception ex) 
		{
			System.out.println("Error: " + ex.toString());
		}
	}
	
}

package calculator;

import java.io.FileInputStream; 
import java.io.FileOutputStream;
import java.io.ObjectInputStream;
import java.io.ObjectOutputStream;
import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;

import calculator.*;

/**
 * Syftet med klassen är att hantera "Calculator"-klassen.
 * @author rj222dq
 *
 */
public class CalculatorManager 
{
	private Calculator calc;
	private double num1, num2;
	private List<String> results;
	private SaveManager sm;
	private String filename;
	private Scanner scanner;
	
	/**
	 * Konstruktor
	 */
	public CalculatorManager(SaveManager sm, String filename, Scanner scanner)
	{
		this.scanner = scanner;
		this.sm = sm;
		this.filename = filename;
		calc = new Calculator();
		num1 = 0;
		num2 = 0;
		results = this.sm.readFromDisk(this.filename);
	}
	
	/**
	 * Spara resultatet
	 * @param saveStr Resultat att spara i form av en sträng
	 */
	private void saveResult(String saveStr)
	{
		// Skriver ut till användaren
		System.out.println(saveStr);
		// Lägger till strängen till listan
		results.add(saveStr);
		// Sparar strängen till fil
		this.sm.saveToDisk(this.filename, results);
	}
	

	
	
	/**
	 * Räknar ut det användaren vill.
	 * @param method Sträng som innehåller metodval.
	 * @param num1 Nummer 1.
	 * @param num2 Nummer 2.
	 * @return Resultatet.
	 */
	public double calculate(String method)
	{
		double result = 0;
		try
		{ 
			if (method.equals("divide"))
			{
				result = calc.divide(num1, num2);
				saveResult("Divide: " + num1 + "/" + num2 +" = " + result);
			}
			else if (method.equals("multiply"))
			{
				result = calc.multiply(num1, num2);
				saveResult("Multiply: " + num1 + "*" + num2 +" = " + result);
			}
			else if (method.equals("add"))
			{
				result = calc.add(num1, num2);
				saveResult("Add: " + num1 + "+" + num2 +" = " + result);
			}
			else if (method.equals("sub"))
			{
				result = calc.sub(num1, num2);
				saveResult("Substraction: " + num1 + "-" + num2 +" = " + result);
			}
			else if (method.equals("pyth"))
			{
				result = calc.pyth(num1, num2);
				saveResult("Pythagoras: " + num1 + " " + num2 +" = " + result);
			}
			else
			{
				throw new RuntimeException("Error. No such method for calculate.");
			}
		}
		catch (Exception ex) 
		{
			System.out.println("Error: " + ex.toString());
		}
		return result;
	}
	
	/**
	 * Skriver ut informationen till användaren
	 */
	private void printInfo()
	{
		System.out.println("Calculator");
		System.out.println("1. Divide");
		System.out.println("2. Add");
		System.out.println("3. Substract");
		System.out.println("4. Multiply");
		System.out.println("5. Pythagoras quest");
		System.out.println("To quit press: Q");
		System.out.println("Previous results press: P");
	}
	
	
	public void start()
	{
		int choosen = 0;
		printInfo();
		String str = this.scanner.nextLine();
		
		if (str.toLowerCase().matches("p"))
		{
			System.out.println("\nPrevious results:");
			for (String string : results) 
			{
				System.out.println(string);
			}
		}
		else if (str.toLowerCase().matches("q"))
		{
			return;
		}
		else 
		{
			choosen = Integer.parseInt(str);				
		}
		// Läser in nummer från användaren
		System.out.print("\n"+"Enter first number:");
		num1 = getDouble();
		
		//System.out.print("Enter second number:");
		//num2 = getDouble(); 
		// Bestämmer och aktiverar valet
		choice(choosen);
	}

	
	private double getDouble() {
		double p1 = 0;
		boolean isDouble = false;
		while(!isDouble){
			try{
				p1 = Double.valueOf(this.scanner.nextLine());
				isDouble = true;
			}
			catch(Exception e){
				p1 = 0;
				System.out.println("Not double, try again\n:");
				System.out.println("Error: " + e.toString());
			}
		}
		return p1;
	}

	
	private void choice(Integer choice)
	{		
		switch (choice) {
		case 1:
			calculate("divide");
			break;
		case 2:
			calculate("add");
			break;
		case 3:
			calculate("sub");
			break;
		case 4:			
			calculate("multiply");
			break;
		case 5:	
			calculate("pyth");
			break;
		}
	}
	
